import React from 'react'
import MySkills from '../Components/MySkills'
import AboutMe from '../Components/AboutMe'
import styled from 'styled-components'

function AboutPage() {
    return (
        <AboutMeStyled>
        <div className="AboutPage">
            <AboutMe />
            <div className="skillsContainer">
                <MySkills skill={'Javascript'} progress={'60%'} width={'60%'} />
                <MySkills skill={'React Js'} progress={'70%'} width={'70%'} />
                <MySkills skill={'Java'} progress={'80%'} width={'80%'} />
                <MySkills skill={'Web Design'} progress={'25%'} width={'25%'} />
                <MySkills skill={'UI/Ux Design'} progress={'76%'} width={'76%'} />
            </div>
        </div>
        </AboutMeStyled>
    )
}

const AboutMeStyled = styled.header`
.SkillsSection{

}
.skills-container{
    .skill-title{
        font-size: 1.4rem;
        font-weight: 400;
    }

    .skill-bar{
        display: flex;
        align-items: center;
        .skill-text{
        }
        .skill-progress{
            width: 100%;
           .progress{
               width: 100%;
               height: .5rem;
               background-color: red;
               margin-left: 1rem;
               background-color: #0381ff3f;
               position: relative;
               .inner-pregress{
                    position: absolute;
                    background-color: #037FFF;
                    height: 100%;
                    bottom: 0;
                    left: 0;
               }
           }
        }
    }
}
`;

export default AboutPage;
